import React from 'react'
import { loremIpsum } from 'lorem-ipsum'

const loremText=loremIpsum({
    count:4
})

function InternshipPage() {
  return (
    <div className='row d-flex flex-column justify-content-center align-items-center w-100 m-2 p-3'>
        <p>Since this is application where I am selling knowledge in programming I find it appropriate to add this page to my E-Commerce Site.</p>
        <h1 className='w-100 d-flex justify-content-center text-primary'>Tacta Internship App</h1>
        <p className='col-5'><span className='font-weight-bold pr-2 align'>About me:</span> <br/>{loremText}</p>
        <p>I like taking risks and like to think about myself as a person whose imagination is not yet died</p>
    </div>
  )
}

export default InternshipPage
